import * as React from "react";
import {RemoteContent} from "../../../shared/models/RemoteContent";
import {RemoteContentComponent} from "../../../shared/components/RemoteContentComponent/RemoteContentComponent";
import {reportStore} from "../../stores/ReportStore";
import {connectToStores} from "../../../shared/alt";
import {Version} from "../../../shared/models/reports/Report";
import {ReportVersionSwitcher} from "./ReportVersionSwitcher";

import "../../../shared/styles/common.scss";

interface PublicProps {
    onChangeVersion: (version: string) => void;
}

export interface ReportDetailsProps extends RemoteContent, PublicProps {
    versionDetails: Version;
    report: string;
    allVersions: string[];
}

export class ReportDetailsComponent extends RemoteContentComponent<ReportDetailsProps, any> {

    constructor() {

        super();
        this.state = {
            published: false
        }
    }

    static getStores() {
        return [reportStore];
    }

    static getPropsFromStores(props: Partial<ReportDetailsProps>): ReportDetailsProps {
        const s = reportStore.getState();
        return {
            versionDetails: s.versionDetails[s.currentVersion],
            report: s.currentReport,
            allVersions: s.versions[s.currentReport],
            ready: s.ready
            && s.versions[s.currentReport] !== undefined
            && s.versionDetails[s.currentVersion] != null,

            onChangeVersion: props.onChangeVersion
        };
    }


    renderContent(props: ReportDetailsProps) {
        const version = props.versionDetails.id;
        return <div>
            <h2>
                Discussion and methods for Child Mortality
            </h2>
            <div className={"text-muted small mb-3"}>20170214-121819-587e0bed</div>


            <div>

            </div>
            <div className={"row mt-4"}>
                <div className={"col-12"}>
                    <h5 className={"font-weight-bold"}>Introduction</h5>
                    <p>
                        Some of the VIMC modelling groups use child mortality in their models. These datasets are
                        commonly
                        presented as Infant Mortality Rate (IMR) for under-1 year olds, and Under-5 Mortality Rate
                        (U5MR). A
                        small number of groups also use the 28-day Neonatal Mortality Rate (NMR).

                        UNWPP provide IMR and U5MR for 1950-2100, but they do not provide NMR. IGME,
                        (http://childmortality.org)
                        provide all three, IMR, U5MR and NMR, but they only provide estimates, not predictions for the
                        future;
                        their 2017 dataset runs only as far as 2016. Furthermore, the first time-point for IGME’s
                        estimates
                        varies from country-to-country, and even for the three data types within the same country.

                        However, it can be well argued from observation that IGME’s estimates appear to model closer to
                        reality
                        than UNWPP’s; IGME appears to record genuine child mortality events, whereas UNWPP shows
                        evidence of
                        considerable smoothing. IGME also provide child mortality data for some countries that UNWPP do
                        not;
                        Marshall Islands and Tuvalu are noteworthy examples, since they are countries that modellers
                        must
                        provide estimates for.
                    </p>
                    <div id="which-source-to-use">
                        <h5 className={"font-weight-bold"}>Which source to use?</h5>
                        <p>For VIMC purposes, the accuracy of data to real-life events is of secondary concern; our
                            primary concern is consistency, both in the sense that we want all modellers to be using the
                            same demographic data, and we want all the variables in that demographic data to be
                            consistent with each other.</p>
                        <p>In discussions, UNWPP acknowledged that the IGME’s child mortality data is of a higher
                            accuracy towards reality, and if time and funding were available, a merging of the two data
                            sources in a consistent way would be ideal. This however is not something we should expect
                            to happen soon, perhaps ever.</p>
                        <p>In the meantime, the use of IGME’s child mortality data, combined with all the other fields
                            from UNWPP would be inconsistent, with the population data and life tables of UNWPP not
                            being matched to IGME’s mortality rates, which differ from UNWPP’s as we’ll see. In any
                            case, we would need to extend IGME’s time range back to 1950 and forward to 2100 to use the
                            two source together.</p>
                        <p>VIMC therefore asks that for VIMC work, the groups should use WPP’s data for IMR and U5MR,
                            with the understanding this is not the ideal choice, but the best compromise. We will then
                            provide Neonatal Mortality data, (which UNWPP do not), in a simple way, that is consistent
                            with UNWPP, but also is guided by the IGME data.</p>
                    </div>
                    <div>
                        <h5 className={"font-weight-bold"}>Results</h5>
                        <p>Finally, we show Montagu’s hybrid neonatal mortality rate, compared to IGME’s. Where the red
                            line is solid, we are able to use IGME data to calculate the NMR/IMR scaling; where the line
                            is dotted, either or both of those fields is not available from IGME for that time point, so
                            we are using the nearest available data.</p>
                        <div className="figure">
                            <img
                                src="data:image/gif;base64,"/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    }
}

export const ReportDetails = connectToStores(ReportDetailsComponent) as ComponentConstructor<PublicProps, undefined>;